import React, { useState, useEffect } from 'react';
import { AiOutlineEdit, AiOutlineDelete } from 'react-icons/ai';

const OrdensDeServico = () => {
  const [ordensDeServico, setOrdensDeServico] = useState([]);

  const fetchData = async () => {
    const response = await fetch('http://localhost:8000/api/ordem-servico');
    const data = await response.json();

    setOrdensDeServico(data);
  };

  useEffect(() => {
    fetchData();
  }, []);

  const handleClick = (item) => {
    // Abrir o modal
  };

  return (
    <div>
      <h1>Lista de Ordens de Serviço</h1>
      {ordensDeServico.length > 0 ? (
        ordensDeServico.map((item) => (
          <div key={item.id}>
            <a href="#" onClick={() => handleClick(item)}>{item.titulo}</a>
            <button>
              <AiOutlineEdit /> Editar
            </button>
            <button>
              <AiOutlineDelete /> Excluir
            </button>
          </div>
        ))
      ) : (
        <div>Carregando ordens de serviço...</div>
      )}
    </div>
  );
};

export default OrdensDeServico;
